ps and you are good to go:</p>\n                                <ol class=\"map-guide\">\n                                    <li>Go to <a class=\"text-bold\" target=\"_blank\" href=\"//maps.google.com\">Google Map</a> </li>\n                                    <li>Search the place you want to add by Entering address / location in input box located on upper-left corner</li>\n                                    <li>Once you get the place you want. It shows details in left sidebar. Click on <i class=\"fa fa-share-alt text-primary\"></i> button</li>\n                                    <li>A popup will appear which will have two tabs <b>Send a link</b> and <b>Embed a Map</b></li>\n                                    <li>Click on <b>Embed a map</b> It will show you chosen Place on Map</li>\n                                    <li>Now click on the dropdown from the left. By default <b>Medium</b> is selected. Click on it and Select <b>Large</b></li>\n                                    <li>Now Click on <b class=\"text-primary\">COPY HTML</b> link from it and <b>Paste</b> that code here in <b>Location on Map</b>.</li>\n                                </ol>','2020-02-27 15:29:43','2020-04-16 11:44:37'),(2476,0,'en','labels','backend.general_settings.contact.title','Contact','2020-02-27 15:29:43','2020-04-16 11:44:37'),(2477,0,'en','labels','backend.general_settings.contact.primary_email_note','This email will be used to correspond \"Contact Us\" emails','2020-02-27 15:29:43','2020-04-16 11:44:37'),(2478,0,'en','labels','backend.general_settings.footer.short_description','Short Description','2020-02-27 15:29:43','2020-04-16 11:44:37'),(2479,0,'en','labels','backend.general_settings.footer.popular_categories','Popular categories','2020-02-27 15:29:43','2020-04-16 11:44:37'),(2480,0,'en','labels','backend.general_settings.footer.featured_courses','Featured courses','2020-02-27 15:29:43','2020-04-16 11:44:37'),(2481,0,'en','labels','backend.general_settings.footer.trending_cour