INSERT INTO `pages` VALUES (1,1,'About Us','about-us','<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\" \"http://www.w3.org/TR/REC-html40/loose.dtd\">\n<html><body><p>En un mundo donde la informaci&oacute;n es uno de los activos m&aacute;s importantes, se deben establecer determinadas \'reglas de juego\' para que sea &iacute;ntegra, confidencial y que se obtenga disponibilidad. Nuestro equipo, est&aacute; conformado por personas que llevan a&ntilde;os en seguridad inform&aacute;tica &amp; hacking &eacute;tico, con aprendizaje constante y desarrollo profesional.<br>\r\n<br>\r\nNuestro equipo, est&aacute; conformado por personas que aman lo que hacen y sienten una pasi&oacute;n profusa por la seguridad inform&aacute;tica.</p>\r\n\r\n<p><br>\r\n<img alt=\"\" style=\"height:200px; width:202px\" src=\"https://xecure-labs.com/photos/1/avatar%202020%20xe.png\">&nbsp;&nbsp;<br>\r\n<br>\r\n<strong>Nickname:</strong> Denisse<br>\r\n<strong>Pa&iacute;s:</strong> M&eacute;xico.<br>\r\n<strong>Rol: </strong>Dise&ntilde;adora&nbsp;gr&aacute;fica, content manager y encargada de marketing.<br>\r\n<strong>Descripci&oacute;n:</strong> Inform&aacute;tica de profesi&oacute;n, adicta al mundo de la tecnolog&iacute;a, involucrada en el gremio educativo con &eacute;nfasis inform&aacute;tico, participante en el desarrollo de un proyecto educativo que fomenta la lectura en ni&ntilde;os. Co-Admin de Underc0de.org/foro Hacking y Seguridad Inform&aacute;tica, moderadora de los subforos Debates y Dise&ntilde;o Gr&aacute;fico, partidaria de redactar temas que causen distintas opiniones y que sean de inter&eacute;s de la comunidad, gusta del Dise&ntilde;o, aunque no por profesi&oacute;n, pero si por afici&oacute;n y Directora General de la revista digital UnderDOCS.<br>\r\n<br>\r\n<br>\r\n<br>\r\n<img alt=\"\" style=\"height:200px; width:200px\" src=\"https://xecure-labs.com/photos/1/Mortal_Poison.jpg\"><br>\r\n<br>\r\n<strong>Nickname:</strong> Mortal_Poison<br>\r\n<strong>Pa&iacute;s:</strong> Colombia<br>\r\n<strong>Rol: </strong>Consultor de seguridad, profesor &amp; desarrollador.<br>\r\n<strong>Descripci&oacute;n:</strong>&nbsp;Durante su trayecto, ha logrado reportar vulnerabilidades a empresas como Facebook, Google, Harvard University, La NASA, Bigpoint, Endian Firewall,&nbsp;Ekkoparty, Blizzard, OVH, CNN, Unikrn, Kiuwan, Steam, entre otras grandes empresas. Ha reportado 2 CVEs y se encuentran p&uacute;blicamente en CVE MITRE. Ha sido ponente de eventos como DragonJar Security Conference[2016], BsidesCO[2017], Barcamp Security, FliSol, entre otros. Instructor de Cybrary, Participante eventual de programas de Bug Bounty en plataformas como HackerOne, VulnScope y YesWeHack.</p></body></html>\n',NULL,1,NULL,NULL,NULL,1,'2020-02-27 15:29:26','2020-04-16 20:41:58',NULL),(2,1,'Privacy Policy','privacy-policy','<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\" \"http://www.w3.org/TR/REC-html40/loose.dtd\">\n<html><body><p><strong>POL&Iacute;TICA DE PRIVACIDAD</strong></p>\r\n\r\n<p>El presente Pol&iacute;tica de Privacidad establece los t&eacute;rminos en que&nbsp;&nbsp;usa y protege la informaci&oacute;n que es proporcionada por sus usuarios al momento de utilizar su sitio web. Esta compa&ntilde;&iacute;a est&aacute; comprometida con la seguridad de los datos de sus usuarios. Cuando le pedimos llenar los campos de informaci&oacute;n personal con la cual usted pueda ser identificado, lo hacemos asegurando que s&oacute;lo se emplear&aacute; de acuerdo con los t&eacute;rminos de este documento. Sin embargo esta Pol&iacute;tica de Privacidad puede cambiar con el tiempo o ser actualizada por lo que le recomendamos y enfatizamos revisar continuamente esta p&aacute;gina para asegurarse que est&aacute; de acuerdo con dichos cambios.</p>\r\n\r\n<p><strong>Informaci&oacute;n que es recogida</strong></p>\r\n\r\n<p>Nuestro sitio web podr&aacute; recoger informaci&oacute;n personal por ejemplo: Nombre,&nbsp; informaci&oacute;n de contacto como&nbsp; su direcci&oacute;n de correo electr&oacute;nica e informaci&oacute;n demogr&aacute;fica. As&iacute; mismo cuando sea necesario podr&aacute; ser requerida informaci&oacute;n espec&iacute;fica para procesar alg&uacute;n pedido o realizar una entrega o facturaci&oacute;n.</p>\r\n\r\n<p><strong>Uso de la informaci&oacute;n recogida</strong></p>\r\n\r\n<p>Nuestro sitio web emplea la informaci&oacute;n con el fin de proporcionar el mejor servicio posible, particularmente para mantener un registro de usuarios, de pedidos en caso que aplique, y mejorar nuestros productos y servicios. &nbsp;Es posible que sean enviados correos electr&oacute;nicos peri&oacute;dicamente a trav&eacute;s de nuestro sitio con ofertas especiales, nuevos productos y otra informaci&oacute;n publicitaria que consideremos relevante para usted o que pueda brindarle alg&uacute;n beneficio, estos correos electr&oacute;nicos ser&aacute;n enviados a la direcci&oacute;n que usted proporcione y podr&aacute;n ser cancelados en cualquier momento.</p>\r\n\r\n<p><strong>Cookies</strong></p>\r\n\r\n<p>Una cookie se refiere a un fichero que es enviado con la finalidad de solicitar permiso para almacenarse en su ordenador, al aceptar dicho fichero se crea y la cookie sirve entonces para tener informaci&oacute;n respecto al tr&aacute;fico web, y tambi&eacute;n facilita las futuras visitas a una web recurrente. Otra funci&oacute;n que tienen las cookies es que con ellas las web pueden reconocerte individualmente y por tanto brindarte el mejor servicio personalizado de su web.</p>\r\n\r\n<p>Nuestro sitio web emplea las cookies para poder identificar las p&aacute;ginas que son visitadas y su frecuencia. Esta informaci&oacute;n es empleada &uacute;nicamente para an&aacute;lisis estad&iacute;stico y despu&eacute;s la informaci&oacute;n se elimina de forma permanente. Usted puede eliminar las cookies en cualquier momento desde su ordenador. Sin embargo las cookies ayudan a proporcionar un mejor servicio de los sitios web, est&aacute;s no dan acceso a informaci&oacute;n de su ordenador ni de usted, a menos de que usted as&iacute; lo quiera y la proporcione directamente. Usted puede aceptar o negar el uso de cookies, sin embargo la mayor&iacute;a de navegadores aceptan cookies autom&aacute;ticamente pues sirve para tener un mejor servicio web. Tambi&eacute;n usted puede cambiar la configuraci&oacute;n de su ordenador para declinar las cookies. Si se declinan es posible que no pueda utilizar algunos de nuestros servicios.</p>\r\n\r\n<p><strong>Enlaces a Terceros</strong></p>\r\n\r\n<p>Este sitio web pudiera contener enlaces a otros sitios que pudieran ser de su inter&eacute;s. Una vez que usted de clic en estos enlaces y abandone nuestra p&aacute;gina, ya no tenemos control sobre al sitio al que es redirigido y por lo tanto no somos responsables de los t&eacute;rminos o privacidad ni de la protecci&oacute;n de sus datos en esos otros sitios terceros. Dichos sitios est&aacute;n sujetos a sus propias pol&iacute;ticas de privacidad por lo cual es recomendable que los consulte para confirmar que usted est&aacute; de acuerdo con estas.</p>\r\n\r\n<p>Se reserva el derecho de cambiar los t&eacute;rminos de la presente Pol&iacute;tica de Privacidad en cualquier momento.</p></body></html>\n',NULL,1,NULL,NULL,NULL,1,'2020-02-27 15:29:26','2020-04-16 20:11:24','2020-04-16 20:11:24'),(3,1,'Politica de Privacidad','politica-de-privacidad','<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\" \"http://www.w3.org/TR/REC-html40/loose.dtd\">\n<html><body><p><strong>POL&Iacute;TICA DE PRIVACIDAD</strong></p>\r\n\r\n<p>El presente Pol&iacute;tica de Privacidad establece los t&eacute;rminos en que&nbsp;&nbsp;usa y protege la informaci&oacute;n que es proporcionada por sus usuarios al momento de utilizar su sitio web. Esta compa&ntilde;&iacute;a est&aacute; comprometida con la seguridad de los datos de sus usuarios. Cuando le pedimos llenar los campos de informaci&oacute;n personal c